import { DiAptana } from 'react-icons/di';

class SettingsButton extends React.Component {
  render() {
    return <Link to="/settings" data-testid="btn-settings"><DiAptana value={{ color: 'red', className: "global-class-name" }} /></Link>;
  }
}

export default SettingsButton;
